	add("dulcimer", "{\"term\":\"dulcimer\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027doulcemelle\u0027 probably from Latin \u0027dulce\u0027 \u0027melos\u0027 (sweet song) from Ancient greek (to 1453) \u0027μέλος\u0027 (melody, song)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stringed instrument, with strings stretched across a sounding board, usually trapezoidal. It\u0027s played on the lap or horizontally on a table. Some have their own legs. These musical instruments are played by plucking on the strings (traditionally with a quill) or by tapping on them (in the case of the hammer dulcimers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The two classes of dulcimer are the \u0026quot;Mountain\u0026quot; or \u0026quot;Appalachian\u0026quot; dulcimer (plucked and played with a quill, usually a goose quill) and the hammer dulcimer (played by tapping on the strings with small \u0026quot;hammers\u0026quot;). See also: zithe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dThe Rime of the Ancient Mariner and Other chapter\u003d|url\u003dhttp://books.google.com/books?id\u003dCSnf5K3vwcQC\u0026amp;pg\u003dPA59\u0026amp;dq\u003ddulcimer+inauthor:Coleridge\u0026amp;hl\u003den\u0026amp;ei\u003d59VFTIeiLMWOjAf86L31Bg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CFAQ6AEwB\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"isbn\u003d9780486272665|page\u003d59|passage\u003dA damsel with a \u0027\u0027dulcimer\u0027\u0027 / In a vision once I saw: / It was an Abyssinian maid / And on her \u0027\u0027dulcimer\u0027\u0027 she played, / Singing of Mount Abora\", \"priority\":4}]}, \"synonyms\":{}}");

